      <script>function sort_numeric(a, b){ return a - b; }
function sort_string(a, b){ return a.localeCompare(b); }

function grimer_sort(factors, sort_col, sort_mode="numeric", desc=false, group_col1=[], group_col2=[], index=[]) {
    //sort_mode : numeric, string

    // subset data if index provided
    if(index.length){
    	factors = index.map( s => factors[s] );
		sort_col = index.map( s => sort_col[s] );
		if(group_col1.length){
			group_col1 = index.map( s => group_col1[s] );
		}
		if(group_col2.length){
			group_col2 = index.map( s => group_col2[s] );
		}
    }

    // Generate numerical index to sort arrays
    var idx = new Array(factors.length);
    for (var i = 0; i < idx.length; ++i) idx[i] = i;
    //If numeric, replace NaN with sortable value (-Infinity) to be at the end of the sorted array
	if (sort_mode=="numeric"){
		sort_col = sort_col.map(function(v){ return isNaN(v) ? -Infinity : v })
	}

	if(group_col1.length && group_col2.length){
		if (sort_mode=="numeric" && desc==false)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[b],sort_col[a]));
		else if (sort_mode=="numeric" && desc==true)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==false)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==true)
			idx.sort((a, b) => sort_string(group_col2[a],group_col2[b]) || sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[b],sort_col[a]));
	}else if(group_col1.length){
		if (sort_mode=="numeric" && desc==false)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[b],sort_col[a]));
		else if (sort_mode=="numeric" && desc==true)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_numeric(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==false)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==true)
			idx.sort((a, b) => sort_string(group_col1[a],group_col1[b]) || sort_string(sort_col[b],sort_col[a]));
	}else{
		if (sort_mode=="numeric" && desc==false)
			idx.sort((a, b) => sort_numeric(sort_col[b],sort_col[a]));
		else if (sort_mode=="numeric" && desc==true)
			idx.sort((a, b) => sort_numeric(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==false)
			idx.sort((a, b) => sort_string(sort_col[a],sort_col[b]));
		else if (sort_mode=="string" && desc==true)
			idx.sort((a, b) => sort_string(sort_col[b],sort_col[a]));
	}

    var sorted_factors = new Array(idx.length);
    for (var i = 0; i < idx.length; ++i) sorted_factors[i] = factors[idx[i]];
    return sorted_factors;
}

function table_to_tsv(source, cols, headers, selected) {

	var rows_idx = []
	if(selected==true){
		//remove undefined from selected if present
		rows_idx = source.selected.indices.filter(function( element ) {
		   return element !== undefined;
		});
	}
	else{
		// include all rows
		for (let i = 0; i < source.get_length(); i++) {
			rows_idx.push(i);
		}
	}

	const lines = [headers.join('\t')]
    for (let i = 0; i < rows_idx.length; i++) {
    	let row = [];
        for (let j = 0; j < cols.length; j++) {
            row.push(source.data[cols[j]][rows_idx[i]].toString())
        }
        lines.push(row.join('\t'))
    }
    return lines.join('\n').concat('\n')
}

function save_file(filename, filetext){
    const blob = new Blob([filetext], { type: 'text/csv;charset=utf-8;' })
    //addresses IE
    if (navigator.msSaveBlob) {
        navigator.msSaveBlob(blob, filename)
    } else {
        const link = document.createElement('a')
        link.href = URL.createObjectURL(blob)
        link.download = filename
        link.target = '_blank'
        link.style.visibility = 'hidden'
        link.dispatchEvent(new MouseEvent('click'))
    }

.value=\"none\";\n            x_sort_select.disabled=true;\n            dendrox.visible=true;\n        }else{\n            cds_p_dendro_x.data = {\"x\": [], \"y\": [], \"c\": []};\n            x_sort_select.disabled=false;\n            dendrox.visible=false;\n        }\n        "},"id":"2102","type":"CustomJS"},{"attributes":{},"id":"1171","type":"CategoricalTickFormatter"},{"attributes":{"data_source":{"id":"1003"},"glyph":{"id":"1166"},"hover_glyph":null,"muted_glyph":null,"name":"direct","nonselection_glyph":{"id":"1167"},"selection_glyph":null,"view":{"id":"1159"}},"id":"1168","type":"GlyphRenderer"},{"attributes":{"args":{"cds_d_metadata":{"id":"1016"},"cds_d_samples":{"id":"1015"},"cds_p_samplebars":{"id":"1002"},"groupby1_select":{"id":"1412"},"groupby2_select":{"id":"1413"},"samplebars":{"id":"1313"},"sort_select":{"id":"1411"}},"code":"\n        // Define value from Sort by select\n        var sort_col;\n        var annot_samples = cds_d_samples.data[\"index\"];\n        if (sort_select.value==\"input_order\"){\n            sort_col = cds_d_samples.data[\"aux|input_order\"];\n        }else if (sort_select.value==\"counts\"){\n            sort_col = cds_d_samples.data[\"cnt|total\"];\n        }else if (sort_select.value==\"selected_annotation\"){\n            sort_col = cds_p_samplebars.data[\"bar|selected\"];\n        }else if (sort_select.value.startsWith(\"metadata_num|\")){\n            sort_col = cds_d_metadata.data[sort_select.value.replace('metadata_num|','')];\n\n            // Annotate label with value\n            var annot_samples = annot_samples.map(function(s, i) {\n              return sort_col[i] + \" | \" + s;\n            });\n\n        }else if (sort_select.value.startsWith(\"tax|\")){\n            sort_col = cds_p_samplebars.data[sort_select.value];\n        }\n\n        // Factors can be: index (sort_col|index), [md1, index] or [md1, md2, index]\n        var factors;\n        var sorted_factors;\n        // If group by is selected, use as first sort factor\n        if(groupby1_select.value!=\"none\"){\n            var groupby_col1 = cds_d_metadata.data[groupby1_select.value.replace('metadata_cat|','')];\n\n            // Zip sample index and metadata field to create nested factors\n            factors = groupby_col1.map(function(m, i) {\n              return [m, annot_samples[i]];\n            });\n\n            // second grouping level\n            if(groupby2_select.value!=\"none\" &amp;&amp; groupby2_select.value!=groupby1_select.value){\n\n                var groupby_col2 = cds_d_metadata.data[groupby2_select.value.replace('metadata_cat|','')];\n\n                factors = groupby_col2.map(function(m, i) {\n                  return [groupby_col1[i], m, annot_samples[i]];\n                });\n\n                sorted_factors = grimer_sort(factors, sort_col, \"numeric\", false, groupby_col2, groupby_col1);\n            }else{\n                sorted_factors = grimer_sort(factors, sort_col, \"numeric\", false, groupby_col1);\n            }\n\n        }else{\n            // Single factors, just use the sample index\n            factors = annot_samples;\n            sorted_factors = grimer_sort(factors, sort_col, \"numeric\", false);\n        }\n\n        // Change value of the factors on the samplebars cds\n        cds_p_samplebars.data[\"aux|factors\"] = factors;\n\n        // Plot sorted factors\n        samplebars.x_range.factors = sorted_factors;\n        "},"id":"2092","type":"CustomJS"},{"attributes":{"code":"pop.open('MGnify', '&lt;p&gt;Pie chart with the number of occurrences of the selected taxa in the table by environment (biome) in other microbiome studies analyzed and publicly available at the &lt;a target=\"_blank\" href=\"https://www.ebi.ac.uk/metagenomics\"&gt;MGnify&lt;/a&gt; [1] resource.&lt;/p&gt;&lt;p&gt;The biomes are hierarchically classified in 5 different levels, from general (1) to specific (5). For example: 1) Host-associated &amp;gt; 2) Human &amp;gt; 3) Digestive system &
